import React from 'react'
import HomePage from "../pages";
import About from "../pages";
import Resume from "../pages";
import Footer from "../pages";
import Project from "../components"

const Main = () => {
  return (
    <React.Fragment>
        <HomePage />
        <About />
        <Project />
        <Resume />
        <Footer />
    </React.Fragment>
  )
}

export default Main
